select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1576091631,message={id=0,msg=""},news={{title="TradeSkillMaster v4.8.22 Changelog",content="TSM v4.8.22 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when evaluating some custom prices.<br />* Fixed error during Sniper.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1576046488,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-22-changelog/"},{title="TradeSkillMaster v4.8.21 Changelog",content="TSM v4.8.21 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Ignoring keyring updates.<br />* [Classic] Fixed an error with profession swapping.<br />* [Classic] Deposit reagent button is disabled for banking.<br />* Properly updating crafting queue when acquiring items.<br />* Fixed error with reseting auctioning operations.<br />* Auctioning saved searches fix.<br />* Sped up inbox scanning.<br />* Disenchanting fixes.<br />* Various optimizations.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1576020813,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-21-changelog/"}}}]]) --<APP_INFO,Global,1576091631>
